import React from 'react';

export const Task = (task) => {
  return (
    <li className="tarea sombra">
      <p>{task.taskTitle}</p>
      <div className="estado">
        {task.status
          ?
            (
              <button
                type="button"
                className="completo"
              >Completo</button>
            )
          :
            (
              <button
                type="button"
                className="incompleto"
              >Incompleto</button>
            )
        }
      </div>
    </li>
  );
};
